require 'test_helper.rb'

class ProcessImageControllerTest < ActionDispatch::IntegrationTest

  base64_input = "data:image/png;base64,"

  test "should respond with success on post request" do
    post process_image_url, params: {"base64": base64_input}
    assert_response :success
  end

  test "should respond with base64 String on post request" do
    post process_image_url, params: {"base64": base64_input}
    assert_match(/^\S+$/, response.body['base64'], "string without any whitespace and at least one char")
  end
end
